import React from 'react';
import "./register.css"


const register = () => {
    return (
        <div className="register">
            <div className="registerform">
                <input type="text" placeholder="username..."/>
                <input type="text" placeholder="password..."/>
                <button>Register</button>
            </div>
        </div>
    );
};


export default register;
